  const theme = useContext(themeContext)
  const darkMode = theme.state.darkMode
  return (
    <div className='App'>
      <Navbar/>
     <Intro />
     <About/>
     <Project />
     <Contact />
     <Footer />
    </div>
  );
}

export default App;
